    false,nt"url": null,nt"notes": "All but one water sample had lead concentrations
    below the detection limit (Table 1). The water sample collected from Ventucopa,
    located in Santa Barbara County, had a lead concentration of 0.002 ppm. This is
    the staging area for operations associated with current release efforts. Results
    - Calf Tissue Samples The results of the calf tissue chemical analysis are presented
    in Table 2. The liver sample from the 3-day of female calf from Paula Rosa #2 Dairy
    (CCBF01) had a lead concentration of 2.56 ppm dry weight (0.64 ppm wet weight).
    The muscle sample from the same calf had a detectable lead concentration of 0.93
    ppm dry weight (0.21 ppm wet weight). The other calf tissue sample with a detectable
    amount of lead was the muscle tissue of one of the 1-day old female calves from
    H-Bar-O Farms (CCBF03). This sample had a lead concentration of 0.30 ppm dry weight
    (0.07 ppm wet weight). The liver sample from the 2 to 3-day old male calf from Paula
    Rosa Car Company (CCBF09) was the only calf tissue sample with a detectable amount
    of any organochlorine (0.013 ppm wet weight p,p'DDE).",nt"license_title": "License
